import React from "react";

import "./Navbar.css";

const navbar = (props) => (
  <div className="main-nav">
    <div className="container">
    <h2 className="logo"><a className="logo-link" href="#oscars">{props.title}</a></h2>
        <ul className="nav-menu">
          li*5
        </ul>

    </div>

  </div>

);

export default navbar;
